const initialState = {
};

export default function(state = initialState, action) {
  switch (action.type) {
      case FETCH_BOOKINGS_SUCCESS:
          console.log('---------', action.payload)
        return {         
          ...state,
          payload: [action.payload.payload],
        }; 
    default:
      return state;
  }
}
